import React, { useEffect } from 'react';
//import { Link, withRouter } from 'react-router-dom';
import { getData } from '../actions/data';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

const DataView = ({ data, getData, props }) => {
	useEffect(() => {
		getData();
	}, [getData]);

	const newsObj = data.map(items => {
		return items;
	});

	console.log(newsObj);

	return <h1 onClick={getData}>Reader</h1>;
};

DataView.propTypes = {
	DataView: PropTypes.func.isRequired,
	data: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
	data: state.data
});

export default connect(mapStateToProps, { getData })(DataView);
